import React, { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './Home.css';
import Login from './Login';
import Slider from "react-slick"; // Slider bileşeni

const Home = () => {
    const [isModalOpen, setIsModalOpen] = useState(false);
    const [isRegister, setIsRegister] = useState(false);
    const [isLoggedIn, setIsLoggedIn] = useState(false);

    const handleOpenModal = (register = false) => {
        setIsRegister(register);
        setIsModalOpen(true);
    };

    const handleCloseModal = () => {
        setIsModalOpen(false);
    };

    // Slider ayarları
    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1
    };

    return (
        <div className="container-fluid">
            <div className="row">
                {/* Sol Reklam Alanı (2 grid) */}
                <div className="col-md-2">
                    <div className="advertisement">
                        <h4>Reklam Alanı 1</h4>
                    </div>
                </div>

                {/* Para Birimleri ve Giriş/Kayıt Butonu (8 grid) */}
                <div className="col-md-8">
                    <div className="row no-gutters">
                        {/* Para birimi kutuları (6 adet 2 grid) */}
                        <div className="col-md-2">
                            <div className="currency-box">Para Birimi 1</div>
                        </div>
                        <div className="col-md-2">
                            <div className="currency-box">Para Birimi 2</div>
                        </div>
                        <div className="col-md-2">
                            <div className="currency-box">Para Birimi 3</div>
                        </div>
                        <div className="col-md-2">
                            <div className="currency-box">Para Birimi 4</div>
                        </div>
                        <div className="col-md-2">
                            <div className="currency-box">Para Birimi 5</div>
                        </div>
                        <div className="col-md-2">
                            <button className="register-box" onClick={() => handleOpenModal(true)}>
                                {isLoggedIn ? "Profilim" : "Giriş Yap/Kayıt Ol"}
                            </button>
                        </div>
                    </div>

                    {/* Slider Alanı */}
                    <div className="slider-section">
                        <Slider {...settings}>
                            <div>
                                <h3>Slide 1</h3>
                            </div>
                            <div>
                                <h3>Slide 2</h3>
                            </div>
                            <div>
                                <h3>Slide 3</h3>
                            </div>
                        </Slider>
                    </div>
                </div>

                {/* Sağ Reklam Alanı (2 grid) */}
                <div className="col-md-2">
                    <div className="advertisement">
                        <h4>Reklam Alanı 2</h4>
                    </div>
                </div>
            </div>

            {/* Modal */}
            {isModalOpen && (
                <div className="modal-overlay">
                    <div className="modal-content">
                        <button className="close-button" onClick={handleCloseModal}>
                            &times;
                        </button>
                        <Login 
                            isOpen={isModalOpen} 
                            onRequestClose={handleCloseModal} 
                            isRegister={isRegister} 
                            setIsLoggedIn={setIsLoggedIn} 
                        />
                    </div>
                </div>
            )}
        </div>
    );
};

export default Home;
